import React from 'react'

export default ({ projects }) => {
  const colors = ["green", "white", "pink", "gray"];
  return (
      projects && projects.map((text, index) =>

        <div class='row'>
          <div class='column'>
            <div class='column-element'>
              {text}
            </div>
          </div>
        </div>
      )
  )
}
